package com.example.exercise_1;

import javax.servlet.*;
import javax.servlet.http.*;
import javax.servlet.annotation.*;
import java.io.IOException;
import java.util.ArrayList;
import java.util.List;

@WebServlet(name = "ListCustomerServlet", urlPatterns = "/ListCustomerServlet")
public class ListCustomerServlet extends HttpServlet {
    @Override
    protected void doGet(HttpServletRequest request, HttpServletResponse response) throws ServletException, IOException {
        List<Customer> customerList = new ArrayList<>();
        customerList.add(new Customer("1","Mai Văn Hoàn","1983-08-20","Hà Nội","data:image/jpeg;base64,"));
        customerList.add(new Customer("1","Nguyễn Văn Nam","1983-08-21","Bắc Giang","data:image/jpeg;base64,"));
        customerList.add(new Customer("1","Nguyễn Thái Hoà","1983-08-22","Nam Định","data:image/jpeg;base64,"));
        customerList.add(new Customer("1","Trần Đăng Khoa","1983-08-17","Hà Tây","data:image/jpeg;base64,"));
        customerList.add(new Customer("1","Nguyễn Đình Thi","1983-08-19","Hà Nội","data:image/jpeg;base64,"));

        request.setAttribute("customerList",customerList);
        RequestDispatcher requestDispatcher = request.getRequestDispatcher("/list.jsp");
        requestDispatcher.forward(request,response);
    }

    @Override
    protected void doPost(HttpServletRequest request, HttpServletResponse response) throws ServletException, IOException {

    }
}
